import React, { Component } from 'react';

class Blueberry extends Component {
    render() { 
        return (  
            <div>
                <h1>Blueberries</h1>
                <h5>Kcal:</h5>
                <p>85 per 1 cup (185g)</p>
                <h5>Macronutrients:</h5>
                <p>Fat: 0.5 g
                    <br>Carbohydrates: 21 g</br>
                </p>
            </div>
        );
    }
}

export default Blueberry;
